.plan-box {
  position: relative;
  height: 52rem;
  background-color: rgba($color-primary, 0.5);
  margin-top: 0.5rem;
  border-radius: 5px;
  width: 90%;
  box-shadow: 0 1.5rem 4rem rgba($color-black, 0.4);
  transition: all 0.3s;

  &:hover {
    transform: translateY(-3px);
    box-shadow: 0 1rem 2rem rgba($color-primary-dark, 0.6);
    background-color: rgba($color-primary, 0.2);
    background-image: none;

    &::after {
      transform: scaleX(1.4) scaleY(1.6);
      opacity: 0;
    }
  }

  h3 {
    font-size: 2rem;
    letter-spacing: 1px;
    text-transform: uppercase;
    font-weight: 300;
    color: $color-white;
  }

  @include respond(phone) {
    margin-top: 5rem;
    width: 100%;
  }
}

.plan-box div {
  padding: 2.5rem 2rem;
  border-bottom: 1px solid #e8e8e8;
}

.plan-box div:first-child {
  margin-left: 0.2rem;
}

.plan-box div:last-child {
  background-color: rgba($color-grey-light-1, 10);
  text-align: center;
  border: 0;
}

.plan-price {
  font-size: 3.8rem;
  margin-bottom: 0.2rem;
  font-weight: 100;
  color: $color-black;
  transition: all 0.1s;
}

.plan-price span {
  font-size: 2rem;
  font-weight: 300;
}

.plan-price-detail {
  font-size: 1.3rem;
  letter-spacing: 1.2px;
  color: $color-primary-dark;
}

.plan-box ul {
  font-size: 1.8rem;
  letter-spacing: 1px;
  list-style: none;
}

.plan-box ul li {
  padding: 1rem;

  &:not(:last-child) {
    border-bottom: 1px solid $color-grey-light-2;
  }
}

.plan-price-btn {
  &,
  &:link,
  &:visited {
    text-transform: uppercase;
    text-decoration: none;
    padding: 1rem 1rem;
    display: inline-block;
    border-radius: 0.5rem;
    transition: all 0.2s;
    position: relative;
    font-size: $default-font-size;
    border: none;
    cursor: pointer;
    color: $color-black;
  }

  &:hover {
    box-shadow: 0 1rem 2rem rgba($color-black, 0.2);
    background-color: rgba($color-primary-dark, 0.3);
  }
}

