.services {
  margin: 0 auto;
}

.wedding {
  position: relative;
  display: grid;
  grid-template-columns: 1fr 1fr;
  margin: 8rem 0;
  height: 70vh;

  @include respond(phone) {
    padding: 10rem 0;
    height: 75vh;
  }

  .wedding__pictures {
    grid-column: 2 / 3;
    display: grid;
    grid-template-rows: repeat(6, 80px);
    grid-template-columns: repeat(6, 1fr);
    align-items: center;

    @include respond(phone) {
      grid-template-rows: repeat(6, 60px);
      justify-items: center;
      grid-column: 1 / 3;
      grid-row: 1 / 2;
    }

    .wedding__img--1 {
      width: 100%;
      grid-row: 5 / 6;
      grid-column: 1 / 4;
      z-index: 100;
      border-radius: 2px;
      background-color: rgba($color-secondary, 0.6);
      box-shadow: 0 2rem 5rem rgba(#000, 0.2);

      @include respond(tab-port) {
        grid-row: 4 / 5;
      }

      @include respond(phone) {
        margin-left: 1rem;
        grid-row: 3 / 4;
        width: 98%;
      }
    }

    .wedding__img--2 {
      width: 100%;
      grid-row: 3 / 4;
      grid-column: 4 / 7;
      margin-left: -2rem;
      background-color: rgba($color-secondary, 0.6);
      box-shadow: 0 2rem 5rem rgba(#000, 0.3);
      border-radius: 2px;
      z-index: 200;

      @include respond(phone) {
        margin-left: 3rem;
        grid-row: 1 / 4;
        width: 102%;
      }
    }
  }

  &__content {
    grid-row: 1 / 2;

    display: flex;
    position: relative;
    flex-direction: column;
    justify-content: flex-start;
    align-items: center;
    padding: 2rem;

    @include respond(phone) {
      grid-column: 1 / 3;
      grid-row: 2 / 4;
      align-items: flex-end;
      justify-content: start;
    }

    h2 {
      padding: 3.5rem 0;
      letter-spacing: 1.3px;
      text-transform: none;
      line-height: 1.35;
      color: rgba($color-secondary, 0.8);
      font-size: 2rem;

      @include respond(phone) {
        padding: 2rem 0;
      }
    }

    h3 {
      font-family: "Lumiera";
      font-weight: 400;
      position: absolute;
      text-transform: uppercase;
      left: 10%;
      top: 22%;
      letter-spacing: 0.1rem;
      z-index: 200;
      white-space: nowrap;
      font-size: 4.5rem;
      line-height: 1.35;
      font-weight: 500;
      // color: rgba($color-secondary, 0.8);

      @include respond(tab-port) {
        font-size: 3.5rem;
        top: 20%;
        left: 12%;
      }

      @include respond(phone) {
        font-size: 4rem;
        width: 60%;
        white-space: normal;
        top: -250%;
        left: -2%;
        line-height: 1.35;
      }

      @include respond(small-phone) {
        width: 60%;
        white-space: normal;
        top: -235%;
        left: -8%;
        padding-bottom: 1rem;
        line-height: 1.65;
      }
    }

    p {
      padding-top: 8rem;
      font-size: 1.7rem;
      line-height: 1.95;

      @include respond(tab-port) {
        padding-top: 7.5rem;
      }

      @include respond(phone) {
        text-align: right;
        padding-top: 0.5rem;
      }
    }
  }
}

.icon::before {
  font-family: "Font Awesome 5 Free";
  display: inline-block;
  font-style: normal;
  font-variant: normal;
  text-rendering: auto;
  -webkit-font-smoothing: antialiased;
}

