sources.scss/layout/_grid.scss:
.row {
  max-width: $grid-width;
  margin: 0 auto;
  //background-color:red;

  &:not(:last-child) {
    margin-bottom: $gutter-vertical;

    @include respond(tab-port) {
      margin-bottom: $gutter-vertical-small;
    }
  }

  @include respond(tab-port) {
    max-width: 50rem;
    padding: 0 2rem;
  }

  @include clearfix;

  [class^="col-"] {
    float: left;

    &:not(:last-child) {
      margin-right: $gutter-horizontal;

      @include respond(tab-port) {
        margin-right: 0;
        margin-bottom: $gutter-vertical-small;
      }
    }

    @include respond(tab-port) {
      width: 100% !important;
    }
  }

  .col-1-of-2 {
    width: calc((100% - #{$gutter-horizontal}) / 2);
  }

  .col-1-of-3 {
    width: calc((100% - 2 * #{$gutter-horizontal}) / 3);
  }

  .col-2-of-3 {
    width: calc(
      2 * ((100% - 2 * #{$gutter-horizontal}) / 3) + #{$gutter-horizontal}
    );
  }
}

sources.scss/layout/_header.scss:
.header {
  display: flex;
  flex-direction: column;
  align-items: center;
  // background-color: $color-grey-light-1;
  padding: 0 3rem;
  background-image: linear-gradient(
      90deg,
      rgba($color-white, 0.8) 35%,
      rgba($color-white, 0.8) -70%,
      transparent 85%
    ),
    url(../resources/images/banner/banner-1-large.jpg);

  background-size: cover;
  background-position: center;
  position: relative;
  background-repeat: no-repeat;
  width: 100%;
  height: 110vh;

  @include respond(phone) {
    background-image: linear-gradient(
        180deg,
        rgba($color-white, 0.8) 15%,
        rgba($color-white, 0.8) 20%,
        transparent 85%
      ),
      url(../resources/images/banner/banner-1.jpg);

    background-size: cover;
    background-position: top;
    position: relative;
    background-repeat: no-repeat;
    height: 85vh;
  }

  &__box {
    // background-color: khaki;
    margin-top: 15rem;
    flex: 1;
    max-width: $grid-width;
    display: grid;
    grid-template-columns: 3fr 2fr;
    row-gap: 3rem;
    align-content: center;
    justify-content: center;
    align-items: start;
    justify-items: start;
    padding: 3rem 0;

    @include respond(phone) {
      margin: 6rem 0;
      grid-template-columns: 1fr;
      grid-template-rows: 3fr;
      row-gap: 1rem;
      align-items: center;
      justify-items: center;
    }
  }

  .heading__box-text {
    padding-right: 1.5rem;
    grid-column: 1 / 2;

    @include respond(phone) {
      padding: 1rem;
      width: 70%;
      background-color: rgba($color-grey-light-1, 0.7);
      border-radius: 5px;
      grid-column: 1 / 2;
      grid-row: 2 / 3;
    }
  }

  .header__btns {
    margin-top: 1.5rem;
    grid-column: 1 / 2;
    grid-row: 4 / 4;
    transition: all 0.5s ease;
    align-items: end;

    // @include respond(phone) {
    //   margin: 1.5rem 0;
    //   grid-column: 1 / 2;
    //   grid-row: 4 / 5;
    // }
  }

  .header__btn {
    &,
    &:link,
    &:visited {
      text-transform: uppercase;
      text-decoration: none;
      display: inline-block;
      transition: all 0.2s;
      position: relative;
      border-radius: 5px;
      cursor: pointer;
      font-size: $default-font-size;
      padding: 1.2rem 2.2rem;
    }

    &:hover {
      transform: translateY(-3px);
      box-shadow: 0 1rem 2rem rgba($color-black, 0.2);

      &::after {
        transform: scaleX(1.4) scaleY(1.6);
        opacity: 0;
      }
    }

    &:active,
    &:focus {
      outline: none;
      transform: translateY(-1px);
      box-shadow: 0 0.5rem 1rem rgba($color-black, 0.8);
    }

    &-one {
      justify-self: center;
      margin-right: 5rem;
      color: $color-white;
      background-color: $color-grey-dark-3;

      &::after {
        background-color: $color-white;
      }
    }

    &-two {
      border: solid 1.2px $color-secondary;
      justify-self: start;
      color: $color-secondary;
      background-color: $color-grey-light-1;

      &::after {
        background-color: $color-secondary;
      }
    }
  }

  .header__img {
    width: 100%;
    grid-column: 2 / 3;
    grid-row: 1 / span 4;
    transform: translateY(-8rem);

    @include respond(phone) {
      grid-column: 1 / 2;
      grid-row: 3 / span 1;
      width: 100%;
      margin: 0 auto;
      transform: translateY(0);

      // transform: translateX(5rem);
    }
  }
}

.highlight {
  position: relative;
  z-index: 10;
  color: #fff;
}

.highlight::after {
  display: block;
  content: "";
  position: absolute;
  bottom: 0;
  left: 0;
  height: 100%;
  width: 100%;
  z-index: -1;
  opacity: 1;
  transform: scale(1.07, 1.05);
  // skewX(-15deg);
  // background-image: var(--gradient-primary);
  background-color: rgba($color-secondary, 0.8);
}

