sources.scss/layout/_navigation.scss:
.navigation {
  width: 100%;
  z-index: 300;
  position: fixed;

  &__bar {
    display: flex;
    justify-content: space-between;
    align-items: center;
    width: 100%;
    padding: 0 6rem;
    height: 10rem;

    @include respond(phone) {
      height: 9rem;
      justify-content: center;
    }
  }

  &__logo {
    margin: 1rem 0;
    img {
      width: 80%;
      padding: 0.5rem 1.8rem 0 0;

      @include respond(tab-port) {
        width: 100%;
        padding: 2rem 0 2rem 0;
      }

      @include respond(phone) {
        width: 150%;
        margin: -6.8rem;
        padding: 0.2rem 0rem 0.2rem 0;
      }

      @include respond(small-phone) {
        width: 140%;

        padding: 0.8rem 0 0.9rem 0;
      }
    }
  }

  &__list {
    display: flex;
    list-style: none;
    font-size: 1.6rem;
    // padding: 5rem 0 5rem 0;

    @include respond(phone) {
      padding: 0 1rem 0.4rem 0;
    }
  }

  &__item {
    display: flex;
    margin-left: 4rem;

    @include respond(tab-port) {
      margin-left: 3rem;
    }

    @include respond(phone) {
      margin-left: 1.2rem;
    }
  }

  &__link {
    color: $color-white;
    text-decoration: none;
    text-transform: uppercase;
    background-color: rgba($color-secondary, 10);
    padding: 1rem 2.5rem;
    border-radius: 10rem;
    letter-spacing: 1px;
    font-weight: 500;
    transition: all 0.2s;

    &:hover {
      transform: translateY(-3px);
      box-shadow: 0 1rem 2rem rgba($color-primary-dark, 0.8);
      background-color: rgba($color-primary-dark, 0.9);

      &::after {
        transform: scaleX(1.4) scaleY(1.6);
        opacity: 0;
      }
    }

    @include respond(phone) {
      letter-spacing: 1.1px;
      padding: 0.8rem 1.4rem;
    }

    @include respond(small-phone) {
      padding: 1rem 0.7rem;
      font-size: 1.4rem;
    }
  }

  .navigation__bar.sticky {
    z-index: 300;
    position: fixed;
    background-color: rgba($color-white, 0.9);
  }
}

